ously Optimized'=>'Tidigare optimerad','Show Optimized Images'=>'Visa optimerade bilder','Reset Status'=>'Återställ status','If you would like to start over again, press the Reset Status button to reset the bulk operation status.'=>'Om du vill starta om, tryck på knappen ”Återställ status” för att återställa statusen för bulkoperationen.','WARNING: This is not a lossless conversion and requires GD or ImageMagick. JPG is much better than PNG for photographic use because it compresses the image and discards data. Transparent images will only be converted if a background color has been set.'=>'VARNING: Detta är ingen förlustfri konvertering och kräver GD eller ImageMagick. JPG är mycket bättre än PNG för fotografier eftersom bilden komprimeras och överflödig data slängs. Genomskinliga bilder kommer endast konverteras om en bakgrundsfärg har angetts.','Not Verified'=>'Inte verifierad','Verified,'=>'Verifierad,','Default'=>'Standard','Optimize Local Images'=>'Optimera lokala bilder']];